				"description": "<div class=\"bbcode\">Now in its 49th year, Britt Festivals, a non-profit organization, is the Pacific Northwest's premier outdoor summer performing arts festival. Located in the historic 1850s gold rush town of Jacksonville, Oregon (USA), Britt presents dozens of summer concerts, featuring world-class artists in classical music, jazz, blues, folk, bluegrass, world, pop and country music. Britt's performance venue is a naturally formed amphitheater set among majestic ponderosa pines and native madrones on the beautiful hillside estate of 19th century photographer Peter Britt. Viewing a map of the facility will give you a clearer picture of how we have combined stadium seating within this natural setting. Tens of thousands of music lovers travel from all over the West to enjoy Britt's world-class performances, spectacular scenery and casual, relaxing atmosphere. <br /><br />Britt is a convenient day's drive from Seattle or San Francisco, and is located just five miles west of Southern Oregon's largest metropolitan area, Medford, and only 15 miles north of Ashland and the world-famous Oregon Shakespeare Festival. Oregon's only National Park, Crater Lake, is a scenic two-hour drive from Britt.</div>",
