				"startDate": "Mon, 18 Apr 2011 20:00:00",
				"description": "<div class=\"bbcode\">SCOPE Productions and KRUI have the pleasure of announcing that The Decemberists will be performing live in the IMU Main Longue on Monday April 18th. <br />The Decemberists have the kind of work ethic rarely seen today.  The band’s artistic vision is uncompromising.  Where most bands settle to write about a personal experience or daily happening, The Decemberists’ lead singer Colin Meloy weaves intricate stories featuring deep characters and a plot that always thickens. <br />The Decemberists creativity doesn’t stop at their lyrics, the band features members who play violins, organs, and even an accordion.  Their music is carefully woven into beautiful sonic tapestry exemplifying what it means to create art. <br />Even with all of those artistic visions The Decemberists still find time to create fun and catchy music.  Their latest album The King is Dead reached number one on the Billboard top 200, selling 94,000 copies in the first week.  For The King is Dead The Decemberists stripped away some of their grandiose musicality to get back in touch with their roots and that is what we can expect on April 18th.  The Decemberists are making something intimate and special for their fans to really connect with. <br />Concertgoers will also be pleased when the soft American folk rocker Justin Townes Earle fills their ears with sweet melodies.  Earle will join the Decemberists, filling the opening slot on the playbill in the nights performance.<br />University of Iowa students with a valid ID can purchase tickets starting Friday, February 11 and tickets will be available to the general public Saturday, February 12 at the IMU Box Office, where students can UBILL up to 8 tickets, and all Ticketmaster locations</div>",
